import React from 'react';
import { Link } from "@reach/router";

const Header = () => {

    return (
        <div className="header">
            <h3><Link to="/players/list">Manage Players</Link></h3>
            <div className="divider"></div>
            <h3><Link to="/players/addplayer">Manage Player Status</Link></h3>
            <img src="img/black.jpg" alt="emblem"></img>
        </div>
    )
}

export default Header;
